                errorMessage: payload,
            }
        case productActions.LOAD_SAVE_PRODUCT:
            return{
                ...state,
                isLoading: true,
            }
        case productActions.LOAD_SAVE_PRODUCT_SUCCESS:
            return{
                ...state,
                isLoading: false,
                products: [...state.products, payload]
            }
        case productActions.LOAD_SAVE_PRODUCT_ERROR:
            return{
                ...state,
                isLoading: false,
                errorMessage: payload,
            }
        case productActions.ADD_PRODUCT_TO__CART:
            return {
                ...state,
                cart: [...state.cart, payload]
            }
        case productActions.DELETE_PRODUCT:
            return {
                ...state,
                isLoading: true,
            }
        case productActions.DELETE_PRODUCT_SUCCESS:
            return {
                ...state,
                products: state.products.filter((product) => product._id !== payload),
                isLoading: false,
            }
        case productActions.DELETE_PRODUCT_ERROR:
            return {
                ...state,
                isLoading: false,
                errorMessage: payload,
            }
        default:
            return state
    }
}

